tables.table_schema:
CREATE TABLE Marine_Debris_Clean_Up_Efforts (
  clean_up_id INT PRIMARY KEY,
  location VARCHAR(255),
  frequency INT
);

CREATE TABLE clean_up_efforts (
    id INT PRIMARY KEY,
    location VARCHAR(255),
    date DATE,
    debris_type VARCHAR(255),
    frequency INT
);

CREATE TABLE debris_types (
    id INT PRIMARY KEY,
    type_name VARCHAR(255),
    description TEXT
);

CREATE TABLE clean_up_locations (
  location_id UUID PRIMARY KEY,
  location_name VARCHAR,
  latitude DECIMAL,
  longitude DECIMAL
);

CREATE TABLE debris_types (
  debris_type_id UUID PRIMARY KEY,
  debris_category VARCHAR,
  description TEXT
);
